  componentDidMount = () => {
    // db petition

    this.setState({
      userLayoutObj: [
        {
          code: 'ClassicHeading1',
          info: { text1: 'Default hello', text2: 'default world' }
        },
        {
          code: 'ClassicHeading1',
          info: { text1: 'Default hello', text2: 'default world' }
        }
      ]
    })
  }

  render () {
    return (
      <div>
        <h1>Builder page</h1>
        <div id="user-web-page">
          User web page
        </div>
      </div>
    )
  }
}

